import React from "react";
import "./styles.scss";
import { Link } from "react-router-dom";
import { Box, Grid, Typography, Divider } from "@material-ui/core";
import WarningIcon from "@material-ui/icons/Warning";
import FilterNoneIcon from "@material-ui/icons/FilterNone";
import StoreIcon from "@material-ui/icons/Store";
import DateRangeIcon from "@material-ui/icons/DateRange";
import ErrorOutlineIcon from "@material-ui/icons/ErrorOutline";
import LocalOfferIcon from "@material-ui/icons/LocalOffer";
import AccessibilityIcon from "@material-ui/icons/Accessibility";
import UpdateIcon from "@material-ui/icons/Update";

export default function Home() {
  return (
    <Box className="home-admin bgr-admin pt-5">
      <Grid container className="list-top px-3" spacing={1}>
        <Grid item xs>
          <Box className="list-top-item">
            <Box>
              <Box className="list-top-item-logo">
                <FilterNoneIcon className="logo-icon" />
              </Box>
              <Typography className="text-box" variant="body1" color="#999">
                Used Space
              </Typography>
              <Typography className="text-box" component="p" color="#333">
                49/50GB
              </Typography>
            </Box>
            <Divider sx={{ textAlign: "center" }} />
            <Box className="list-top-item-bottom">
              <WarningIcon style={{ color: "red" }} />
              <Link to="/admin" className="text-decoration-none text-danger">
                <Typography variant="caption">Get more space</Typography>
              </Link>
            </Box>
          </Box>
        </Grid>
        <Grid item xs>
          <Box className="list-top-item"></Box>
        </Grid>
        <Grid item xs>
          <Box className="list-top-item"></Box>
        </Grid>
        <Grid item xs>
          <Box className="list-top-item"></Box>
        </Grid>
      </Grid>
    </Box>
  );
}

const listTop = [
  {
    title: "Used Space",
    icons: <FilterNoneIcon className="logo-icon" />,
    iconCaption: <WarningIcon style={{ color: "red" }} />,
    body: "49/50GB",
    caption: "Get more space",
  },
  {
    title: "Revenue",
    icons: <StoreIcon className="logo-icon" />,
    iconCaption: <DateRangeIcon style={{ color: "#999" }} />,
    body: "$34,245",
    caption: "last 24 Hours",
  },
  {
    title: "Fixed Issues",
    icons: <ErrorOutlineIcon className="logo-icon" />,
    iconCaption: <LocalOfferIcon style={{ color: "#999" }} />,
    body: "75",
    caption: "Tracked from Github",
  },
  {
    title: "Follwers",
    icons: <AccessibilityIcon className="logo-icon" />,
    iconCaption: <UpdateIcon style={{ color: "#999" }} />,
    body: "+245",
    caption: "Just Updated",
  },
];
